import React from "react";
import Schule from "./Components/Schule/Schule";

function App() {
  return (
    <div className="App">
      <div className="container-fluid">
        <div className="row">
          <div className="col-9 notes-container" />

          <div className="col-3 card-notes">
            <Schule />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
